import { useRef, useState } from 'react'
import { images } from '../constants'

function LoginAccount() {
  const width = useRef(window.innerWidth).current
  const height = useRef(window.innerHeight).current
  return (
    <div
      style={{
        backgroundColor: '#141518',
      }}
    >
      <div
        style={{
          display: 'flex',
          height: height * 0.08,
          flexDirection: 'row',
        }}
      >
        <div
          style={{
            height: height * 0.08,
            width: width * 0.1,
            display: 'flex',
            flexDirection: 'row',
          }}
        >
          <img
            src={images.thu}
            style={{
              height: 26,
              marginTop: 16,
              marginLeft: 12,
            }}
          />
          <span
            style={{
              fontSize: 15,
              fontWeight: '500',
              alignSelf: 'center',
              color: '#eaeaea',
            }}
          >
            Back to T&C
          </span>
        </div>
      </div>
    </div>
  )
}

export default LoginAccount
